function day3part1(map) {
  let x = 0
  let trees = 0
  for (let i = 1; i < map.length; i++) {
    let line = map[i]
    x += 3
    if (x >= line.length) {
      x = x - line.length
    }
    if (line[x] == '#') {
      trees++
    }
  }
  return trees
}

