function day3part2(map, corArr) {
  let trees = []
  corArr.forEach(element => {
    let x = element[0]
    let y = element[1]
    let count = 0
    let col = 0
    for (let i = y; i < map.length; i += y) {
      let line = map[i]
      col += x
      if (col >= line.length) {
        col = col - line.length
      }
      if (line[col] == '#') {
        count++
      }
    }
    trees.push(count)
  });
  let mult = 1
  trees.forEach(tree => {
    mult *= tree
  })
  return mult
}

