function day5part1(input) {

  let high = 0
  for (let i = 0; i < input.length; i++) {
    let row = input[i].split('').splice(0, 7)
    let col = input[i].split('').splice(7, 3)
    let highX = 127
    let highY = 7
    let lowX = 0
    let lowY = 0
    let x = 64
    let y = 4
    row.forEach((c, i) => {
      switch (c) {
        case 'B':
          x = highX
          lowX = (lowX / 2 + x / 2)
          break;
        case 'F':
          debugger
          x = lowX
          highX = (highX / 2 + x / 2)
          break;
      }
      // console.log(highX, lowX, x, c)
    })
    col.forEach((c, i) => {
      switch (c) {
        case 'R':
          y = highY
          lowY = (lowY / 2 + y / 2)
          break;
        case 'L':
          debugger
          y = lowY
          highY = (highY / 2 + y / 2)
          break;
      }
      // console.log(highX, lowX, x, c)
    })
    console.log(x, y, i)
    console.log("\n")

    high = Math.round(x) * 8 + Math.round(y) > high ? Math.round(x) * 8 + Math.round(y) : high
  }
  return high
}

function day5part2(input) {
  let high = 0
  let plane = []
  let IDs = []
  for (let i = 0; i < input.length; i++) {
    let seat = {}
    let row = input[i].split('').splice(0, 7)
    let col = input[i].split('').splice(7, 3)
    let highX = 127
    let highY = 7
    let lowX = 0
    let lowY = 0
    let x = 64
    let y = 4
    row.forEach((c, i) => {
      switch (c) {
        case 'B':
          x = highX
          lowX = Math.round(lowX / 2 + x / 2)
          break;
        case 'F':
          x = lowX
          highX = Math.round(highX / 2 + x / 2) - 1
          break;
      }
      console.log(highX, lowX, x, c)
    })
    col.forEach((c, i) => {
      switch (c) {
        case 'R':
          y = highY
          lowY = Math.round(lowY / 2 + y / 2)
          break;
        case 'L':
          y = lowY
          highY = Math.round(highY / 2 + y / 2) - 1
          break;
      }
      console.log(highX, lowX, x + 1, c)
    })
    // console.log(x, y, i)
    console.log("\n")
    seat = { x: x, y: y }
    plane.push(seat)
    IDs.push(x * 8 + y)
  }
  let sorted = plane.sort((a, b) => (a['x'] + a['y'] * .1) - (b['x'] + b['y'] * .1))


  let idSort = IDs.sort((a, b) => a - b)
  console.log(idSort.filter(i => i > 550 && i < 580))
  console.log(sorted)
}

