function day8part1(input) {
  let list = []
  let acc = 0
  for (let i = 0; i < input.length; i = i) {
    let ins = input[i].split(' ')[0]
    let value = +input[i].split(' ')[1]
    if (!list.includes(i)) {
      switch (ins) {
        case 'nop':
          list.push(i)
          i++
          break;
        case 'acc':
          list.push(i)
          acc += value
          i++
          break;
        case 'jmp':
          list.push(i)
          i += value
          break;
      }
    } else {
      return acc
    }
  }
}

function day8part2(input) {
  let arr = input
  let list = []
  let acc = 0
  for (let i = 0; i < arr.length; i = i) {
    if (list.length == 0) {
      debugger
    }
    let ins = arr[i].split(' ')[0]
    let value = +arr[i].split(' ')[1]
    if (!list.includes(i)) {
      switch (ins) {
        case 'nop':
          list.push(i)
          i++
          break;
        case 'acc':
          list.push(i)
          acc += value
          i++
          break;
        case 'jmp':
          list.push(i)
          i += value
          break;
      }
    } else {
      switch (arr[list[list.length - 1]].split(" ")[0]) {
        // nop / jmp reverse
        case 'nop':
          let jmp = 'jmp ' + arr[list[list.length - 1]].split(" ")[1]
          arr.splice(list[list.length - 1], 1, jmp)
          debugger
          i = 0
          acc = 0
          list = []
          break;

        case 'jmp':
          let nop = 'nop ' + arr[list[list.length - 1]].split(" ")[1]
          arr.splice(list[list.length - 1], 1, nop)
          debugger
          i = 0
          acc = 0
          list = []
          break;
      }
    }
  }
  return acc
}

