function day9Part1(input, preamble) {
  let arr = input.slice(preamble)
  let pre = arr.slice(0, preamble + 1)
  let count = 0
  for (let i = 0; i < arr.length; i++) {
    let num = arr[i]
    let check = input.slice(i, preamble + i + 1)
    let valid = false
    console.log(num, check)
    check.forEach(x => {
      check.forEach(y => {
        debugger
        if (+x + +y == +num) {
          valid = true
          return
        }
      })
    })
    if (!valid) {
      return num
    }
  }
  return count
}

