function day9Part2(input, preamble) {
  let arr = input.slice(preamble)
  // let pre = arr.slice(0, preamble + 1)
  let code = 0
  for (let i = 0; i < arr.length; i++) {
    let num = arr[i]
    let check = input.slice(i, preamble + i + 1)
    let valid = false
    // console.log(num, check)
    check.forEach(x => {
      check.forEach(y => {
        if (+x + +y == +num) {
          valid = true
          return
        }
      })
    })
    if (!valid) {
      code = num
    }
    if (code > 0) {
      break;
    }
  }
  console.log(code)
  let count = 0
  let nums = []
  for (let x = 0; x < input.length; x++) {
    let num1 = +input[x]
    count += num1
    nums.push(num1)
    for (let y = x + 1; y < input.length; y++) {
      let num2 = +input[y]
      debugger
      count += num2
      nums.push(num2)
      if (count == code) {
        let minMax = nums.sort((a, b) => a - b)
        console.log(minMax[0], minMax[minMax.length - 1])
        return minMax[0] + minMax[minMax.length - 1]
      }
      if (count > code) {
        break;
      }
    }
    count = 0
    nums = []
  }
}

