function day11Part1(input) {
  let previous = []
  let count = 0
  for (let i = 0; i < 1000; i++) {
    previous = input.map(i => i)
    let seats = previous.map(i => i)
    for (let r = 0; r < input.length; r++) {
      let row = input[r]
      for (let col = 0; col < row.length; col++) {
        let chair = row[col]
        let crowd = 0
        if (chair != '.') {
          // above check
          if (input[r - 1]) {
            if (input[r - 1][col - 1] == "#") {
              crowd++
            }
            if (input[r - 1][col] == '#') {
              crowd++
            }
            if (input[r - 1][col + 1] == '#') {
              crowd++
            }
          }
          // bellow check
          if (input[r + 1]) {
            if (input[r + 1][col - 1] == "#") {
              crowd++
            }
            if (input[r + 1][col] == '#') {
              crowd++
            }
            if (input[r + 1][col + 1] == '#') {
              crowd++
            }
          }
          // same level checks
          if (input[r][col - 1]) {
            if (input[r][col - 1] == '#') {
              crowd++
            }
          }
          if (input[r][col + 1]) {
            if (input[r][col + 1] == '#') {
              crowd++
            }
          }
          // change checks
          if (chair == '#') {
            if (crowd > 3) {
              let el = seats[r].split('')
              el.splice(col, 1, "L")
              count--
              seats.splice(r, 1, el.join(""))
              crowd = 0
            }
          } else if (chair == 'L') {
            if (crowd < 1) {
              let hash = seats[r].split('')
              hash.splice(col, 1, "#")
              count++
              seats.splice(r, 1, hash.join(""))
              crowd = 0
            }
          }
        }
      }
    }
    input = seats.map(i => i)
  }
  console.log(input)
  return count
}

